import{Snowflake}from"./class.min.mjs";import{showPage}from"/scripts/src/load-page.min.mjs";import{$}from"/scripts/src/main.min.mjs";function load(){const applet=new Snowflake($("#output-canvas")),resolutionInputElement=$("#resolution-input"),computationsPerFrameInputElement=$("#computations-per-frame-input"),rhoInputElement=$("#rho-input"),betaInputElement=$("#beta-input"),alphaInputElement=$("#alpha-input"),thetaInputElement=$("#theta-input"),kappaInputElement=$("#kappa-input"),muInputElement=$("#mu-input"),gammaInputElement=$("#gamma-input");applet.setInputCaps([resolutionInputElement,computationsPerFrameInputElement],[1e3,20]),$("#randomize-parameters-button").addEventListener("click",()=>{rhoInputElement.value=Math.round(1e5*(.3+.3*Math.random()))/1e5,betaInputElement.value=Math.round(1e5*(.9+(1.7-.9)*Math.random()))/1e5,alphaInputElement.value=Math.round(1e5*(.2+(.6-.2)*Math.random()))/1e5,thetaInputElement.value=Math.round(1e5*(.01+.04*Math.random()))/1e5,kappaInputElement.value=Math.round(1e5*(0+.01*Math.random()))/1e5,muInputElement.value=Math.round(1e5*(0+.065*Math.random()))/1e5,muInputElement.value=Math.round(1e5*(0+.05*Math.random()))/1e5}),$("#generate-button").addEventListener("click",function(){var resolution=parseInt(resolutionInputElement.value||500),computationsPerFrame=parseInt(computationsPerFrameInputElement.value||25),rho=parseFloat(rhoInputElement.value||.45),beta=parseFloat(betaInputElement.value||1.3),alpha=parseFloat(alphaInputElement.value||.4),theta=parseFloat(thetaInputElement.value||.03),kappa=parseFloat(kappaInputElement.value||.005),mu=parseFloat(muInputElement.value||.0325),gamma=parseFloat(gammaInputElement.value||.025);applet.run({resolution:resolution,computationsPerFrame:computationsPerFrame,rho:rho,beta:beta,alpha:alpha,theta:theta,kappa:kappa,mu:mu,gamma:gamma})}),$("#download-button").addEventListener("click",()=>applet.wilson.downloadFrame("a-gravner-griffeath-snowflake.png")),showPage()}export{load};